INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (27, "人助けが大好き！　前向き格闘娘", "東山奈央", "トゥインクルウィッシュ", 2, 16, "A", 155, 100101, "ヒヨリ", "獣人族", "人助け、応援", 44, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", "トゥインクルウィッシュ", 2, 17, "O", 158, 100201, "ユイ", "ヒューマン", "料理、人間観察", 47, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "クールで何事にも真っ直ぐな剣士", "早見沙織", "トゥインクルウィッシュ", 2, 18, "B", 163, 100301, "レイ", "魔族", "読書、乗馬、お茶", 46, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "探検好きのイタズラっ子", "諸星すみれ", "リトルリリカル", 5, 9, "O", 128, 100401, "ミソギ", "ヒューマン", "いたずら、探検", 27, 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (25, "ヒーローに憧れる騎士見習いの少女", "下田麻美", "王宮騎士団（NIGHTMARE）", 8, 12, "O", 146, 100501, "マツリ", "獣人族", "ヒーローごっこ", 40, 11, "？？？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "甘え上手なみんなの人気者", "浅倉杏美", "悪魔偽王国軍（ディアボロス）", 7, 13, "O", 150, 100601, "アカリ", "魔族", "サックス", 42, 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (23, "プリン大好きゴースト娘", "雨宮天", "悪魔偽王国軍（ディアボロス）", 7, 14, "B", 130, 100701, "ミヤコ", "魔族", "プリンを食べること", 32, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ボクは誰よりも美しい", "大空直美", "ヴァイスフリューゲル　ランドソル支部", 15, 14, "AB", 150, 100801, "ユキ", "エルフ", "鏡で自分を見ること", 40, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", "トワイライトキャラバン", 13, 17, "A", 159, 100901, "アンナ", "魔族", "小説執筆", 45, 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "マホマホ王国のプリンセス", "内田真礼", "自警団（カォン）", 10, 16, "O", 155, 101001, "マホ", "獣人族", "空想、ぬいぐるみ集め", 42, 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (25, "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", "ラビリンス", 3, 15, "A", 156, 101101, "リノ", "ヒューマン", "お裁縫", 44, 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (24, "みんなのために超能力を使う眠り姫", "大橋彩香", "フォレスティエ", 6, 17, "A", 156, 101201, "ハツネ", "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 46, 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (21, "オタク全開な魔法少女", "佳村はるか", "トワイライトキャラバン", 13, 18, "O", 166, 101301, "ナナカ", "魔族", "読書、魔法", 55, 8, "", 0);
