INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "天真爛漫で人気者のカリスマモデル", "上坂すみれ", "ルーセント学院", 14, 17, "O", 167, 101601, "スズナ", "魔族", "ファッション", 48, 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "いつでも「なんくるないさ～」な天然娘", "高森奈津美", "自警団（カォン）", 10, 17, "A", 158, 101701, "カオリ", "獣人族", "踊り、空手", 53, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "多くの男性を魅了する無垢な女教師", "伊藤静", "ルーセント学院", 14, 23, "B", 162, 101801, "イオ", "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", "リトルリリカル", 5, 10, "O", 117, 102001, "ミミ", "獣人族", "かわいいもの集め", 21, 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", "サレンディア救護院", 9, 12, "B", 150, 102101, "クルミ", "ヒューマン", "観劇、おままごと", 40, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "人見知りであまのじゃくな女の子", "原紗友里", "悪魔偽王国軍（ディアボロス）", 7, 13, "O", 150, 102201, "ヨリ", "魔族", "ゲーム全般", 40, 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ぷうきちといつも一緒！", "芹澤優", "サレンディア救護院", 9, 14, "B", 148, 102301, "アヤネ", "ヒューマン", "屋内でできる遊び", 38, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", "サレンディア救護院", 9, 15, "O", 154, 102501, "スズメ", "ヒューマン", "ご奉仕", 43, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (1, "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", "牧場（エリザベスパーク）", 11, 17, "B", 144, 102601, "リン", "獣人族", "あんパン", 42, 1, "test", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (30, "運命の相手に一途すぎる乙女", "橋本ちなみ", "トワイライトキャラバン", 13, 16, "B", 154, 102701, "エリコ", "魔族", "実験、裁縫、料理", 43, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (4, "救護院を経営する優しい庶民派お嬢様", "堀江由衣", "サレンディア救護院", 9, 17, "A", 156, 102801, "サレン", "エルフ", "経営、お茶会", 43, 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (24, "歌って踊れる大人気アイドル", "日笠陽子", "カルミナ", 4, 17, "B", 157, 102901, "ノゾミ", "ヒューマン", "舞台鑑賞、ダンス", 40, 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (31, "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", 15, 16, "O", 163, 103001, "ニノン", "ヒューマン", "忍法開発", 51, 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "占いが得意な霊能少女", "大坪由佳", "悪魔偽王国軍（ディアボロス）", 7, 18, "AB", 157, 103101, "シノブ", "魔族", "占い", 42, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "一人前の商人を目指すパワフルお嬢様", "松嵜麗", "メルクリウス財団", 12, 18, "AB", 157, 103201, "アキノ", "ヒューマン", "慈善事業", 45, 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "みんなを笑顔にするお笑い牧場主", "新田恵海", "牧場（エリザベスパーク）", 11, 20, "B", 142, 103301, "マヒル", "ヒューマン", "漫才", 35, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "純情でほっとけない大人の女性", "今井麻美", "メルクリウス財団", 12, 22, "A", 164, 103401, "ユカリ", "エルフ", "ウインドーショッピング", 55, 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "礼儀正しくしっかり者のちびっ子優等生", "小倉唯", "リトルリリカル", 5, 8, "A", 118, 103601, "キョウカ", "エルフ", "お勉強", 21, 2, "test", 0);
