INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "読書が趣味の病弱少女", "小清水亜美", "牧場（エリザベスパーク）", 11, 14, "A", 153, 103801, "シオリ", "獣人族", "読書、お散歩", 40, 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (6, "「友達」に憧れる、エルフの森の女の子", "花澤香菜", "フォレスティエ", 6, 13, "AB", 158, 104001, "アオイ", "エルフ", "友達作りのイメトレ", 44, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "人々を守るために歌う、唱喚士の少女", "福原綾香", "カルミナ", 4, 17, "O", 163, 104201, "チカ", "ヒューマン", "各種楽器", 46, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "男勝りで情に厚いワイルド娘", "小松未可子", "自警団（カォン）", 10, 17, "O", 168, 104301, "マコト", "獣人族", "お菓子作り", 54, 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 0);
