INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (19, "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", 15, 18, "AB", 157, 104501, "クウカ", "ヒューマン", "小説を読むこと", 49, 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (1, "弱きを助け強きをくじく猫娘", "沼倉愛美", "メルクリウス財団", 12, 19, "AB", 158, 104601, "タマキ", "獣人族", "猫とたわむれること", 48, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (25, "素顔を見せない冷静沈着な女性騎士", "川澄綾子", "王宮騎士団（NIGHTMARE）", 8, 25, "A", 171, 104701, "ジュン", "ヒューマン", "格闘技、湯浴み", 50, 10, "？？？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "仕事も私事も効率優先な傭兵少女", "田所あずさ", "メルクリウス財団", 12, 20, "O", 163, 104801, "ミフユ", "ヒューマン", "傭兵などのアルバイト", 49, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (24, "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", "ラビリンス", 3, 18, "O", 168, 104901, "シズル", "ヒューマン", "家事全般", 54, 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0);
