INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "実験が趣味の危険な科学者", "三石琴乃", "トワイライトキャラバン", 13, 27, "A", 166, 105101, "ミツキ", "ヒューマン", "研究、実験", 53, 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "乙女チックなもふもふアニマル", "徳井青空", "牧場（エリザベスパーク）", 11, 17, "A", 150, 105201, "リマ", "獣人族", "毛繕い、お喋り", 100, 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (28, "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", "ヴァイスフリューゲル　ランドソル支部", 15, 17, "A", 140, 105301, "モニカ", "ヒューマン", "お菓子屋通い", 33, 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 0);
