INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (1, "弱きを助け強きをくじく猫娘", "沼倉愛美", "メルクリウス財団", 12, 19, "AB", 158, 107901, "タマキ（サマー）", "獣人族", "猫とたわむれること", 48, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "仕事も私事も効率優先な傭兵少女", "田所あずさ", "メルクリウス財団", 12, 20, "O", 163, 108001, "ミフユ（サマー）", "ヒューマン", "傭兵などのアルバイト", 49, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "占いが得意な霊能少女", "大坪由佳", "悪魔偽王国軍（ディアボロス）", 7, 18, "AB", 157, 108101, "シノブ（ハロウィン）", "魔族", "占い", 42, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (23, "プリン大好きゴースト娘", "雨宮天", "悪魔偽王国軍（ディアボロス）", 7, 14, "B", 130, 108201, "ミヤコ（ハロウィン）", "魔族", "プリンを食べること", 32, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "ちょっとおませな恋に恋する女の子", "久野美咲", "ルーセント学院", 14, 11, "A", 120, 108301, "ミサキ（ハロウィン）", "魔族", "ファッション誌鑑賞、コスメ集め", 22, 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "人々を守るために歌う、唱喚士の少女", "福原綾香", "カルミナ", 4, 17, "O", 163, 108401, "チカ（クリスマス）", "ヒューマン", "各種楽器", 46, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", "サレンディア救護院", 9, 12, "B", 150, 108501, "クルミ（クリスマス）", "ヒューマン", "観劇、おままごと", 40, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ぷうきちといつも一緒！", "芹澤優", "サレンディア救護院", 9, 14, "B", 148, 108601, "アヤネ（クリスマス）", "ヒューマン", "屋内でできる遊び", 38, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (27, "人助けが大好き！　前向き格闘娘", "東山奈央", "トゥインクルウィッシュ", 2, 16, "A", 155, 108701, "ヒヨリ（ニューイヤー）", "獣人族", "人助け、応援", 44, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", "トゥインクルウィッシュ", 2, 17, "O", 158, 108801, "ユイ（ニューイヤー）", "ヒューマン", "料理、人間観察", 47, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "クールで何事にも真っ直ぐな剣士", "早見沙織", "トゥインクルウィッシュ", 2, 18, "B", 163, 108901, "レイ（ニューイヤー）", "魔族", "読書、乗馬、お茶", 46, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (30, "運命の相手に一途すぎる乙女", "橋本ちなみ", "トワイライトキャラバン", 13, 16, "B", 154, 109001, "エリコ（バレンタイン）", "魔族", "実験、裁縫、料理", 43, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0);
