INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (1, "英霊と契約を結んだマナリアの天才王女", "日笠陽子", "？？？", "", 17, "AB", 156, 109201, "アン", "ヒューマン", "読書", 55, 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 0);
